import { Fragment } from "react";
import Box from "@mui/material/Box";
import Card from '@mui/material/Card';

function CardBox(){
    return(
        <Fragment>
            <Box
                sx={{
                    alignItems: 'center',
                    border: '1px solid black',
                    backgroundColor: 'grey'
                }}
            >
                <Card
                    sx={{
                        width:200,
                        height:200,
                        m: 2
                    }}
                >
                    Card Content
                </Card>
            </Box>
        </Fragment>
    )
}

export default CardBox;
